                        <Link to="/">首页</Link>
                        <span> | </span>
                        <Link to="/use">用户中心</Link>
                    </div>


                    <Switch>
                        <Route excal path="/" component={HomePage} />
                        <Route path="/use" component={UsePage} />
                    </Switch>
                </Router>
            </div>
        )
    }
}

